(9, 'Shock! Vlados suitsetab!', 'Мужики а че там за работа по матеше', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(10, 'Autoostjad on hakanud eelistama vähemsaastavaid sõidukeid', 'Auto müügi- ja teenindusettevõtete Eesti liidu (AMTEL) liikmed loodavad, et kehtestatav automaks tuleks võimalikult lihtne ja et otsustajad enne ka nendega nõu peaks.\r\n\r\n\"Kindlasti on mõistlik maksustada sõidukid nende heitmete ehk CO2 järgi,\" rääkis AMTEL-i tegevjuht Meelis Telliskivi.\r\n\r\nTelliskivi nentis, et kuigi Eesti autopark on üldiselt üsna vana, raskepärane ja seega ka saastav, on inimeste mõtlemises juba muutus teadlikkuse suunas toimumas.', , 2, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(11, 'Prokuratuur ei näe alust Slava Ukraini suhtes menetluse alustamiseks', 'Prokuratuur teatas, et praeguse info kohaselt ei näe ta alust uurimise algatamiseks MTÜ Slava Ukraini suhtes, mis on sattunud annetusraha ebakorrektse kasutamise kahtluse alla.\r\n\r\n\"Hetkel teadaoleva põhjal ei ole Eestis kriminaalmenetluse alustamiseks alust. Kuivõrd kahtluse alla sattunud teod on toime pandud Ukrainas, peaks ka uurimine läbi viidama eelkõige Ukrainas,\" ütles prokuratuuri pressiesindaja Kairi Küngas esmaspäeval ERR-ile.', , 5, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(12, 'Eesti ei luba sõjaväkke võtmise eest pagevaid venelasi üle piiri', '\"Venemaa mobilisatsioonikutse või soovimatus Venemaal mobilisatsiooni või mõnd muud kodanikukohustust täita ei ole ajend Eestisse pääsemiseks. Eesti ja Euroopa piiride avamine kümnetele või sadadele tuhandetele täisjõus meestele on reaalne julgeolekuoht, mida me ei saa lubada,\" ütles siseministeeriumi sisejulgeoleku asekantsler Veiko Kommusaar esmaspäeval ERRile.\r\n\r\n', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(13, 'Martin Herem: miks on Nursipalu harjutusvälja laiendamisega kiire?', 'Ükskõik, millise tulemusega Ukraina sõda lõpeb, tuleb meil valmis olla Venemaa järgmiseks agressiooniks kahe-kolme aasta jooksul pärast seda. Seetõttu tuleb suurendada kaitseväe väljaõppe mahtu ja liitlaste kohalolu, milleks on vaja ka uusi harjutusvälju, leiab kaitseväe juhataja kindral Martin Herem.\r\n\r\n', , 1, 1);

